  const filterEncounterDetails = (p) => {
    if (p) {
      return p.filter((p) => {
        if (p.version_details[0].version.name === "pearl") {
          return p.version_details[0].encounter_details;
        } else {
          return p.version_details[1].encounter_details;
        }
      });
    } else {
      return;
    }
  };

  pokemon && console.log(filterEncounterDetails(pokemon));
  return <></>;
}

